import React from "react";
import '../style.css';

export const Legend = ({ id, inText = "", textColorIn = "rgba(0,0,0,0)",
    bkgColor = "rgba(0,0,0,0)", borderColor = "none", ifLeft = false, ifHide = false }) => {
    //textColorIn is for text color inside the legend

    console.log(bkgColor);

    var updateStyle = {};
    if (ifHide) {
        updateStyle.color = "rgba(0,0,0,0)";
    }
    else {
        updateStyle.color = textColorIn;
        updateStyle.background = bkgColor;
        updateStyle.boxShadow = borderColor;
    }

    var tempTextClass = (ifLeft) ? "" : "not-left";
    if (ifHide) {
        tempTextClass += " trans-text";
    }


    return (
        <div className='legend-or-scale-flex'>
            <div className='legend fading'
                style={updateStyle}>{inText}</div>
            <div className={'legend-or-scale-text small-font fading ' + tempTextClass}>{id}</div>
        </div>
    );
}

export const ColorScale = ({ id, baseColor, increaseFactor, colorNum, ifLeft = false, ifHide = false }) => {
    //base color is in {r, g, b}
    var tempTextClass = (ifLeft) ? "" : "not-left";
    if (ifHide) {
        tempTextClass += " trans-text";
    }

    var tempIncreaseFactor = (ifHide) ? 0 : increaseFactor;

    return (
        <div className='legend-or-scale-flex'>
            {Array.from(Array(colorNum).keys()).map(n => {
                var tempClass = "scale fading ";
                var tempColor = "rgba(" + baseColor.r + "," + baseColor.g + "," + baseColor.b + "," + tempIncreaseFactor * (n + 1) + ")";
                if (n === 0) tempClass += " start";
                else if (n === colorNum - 1) tempClass += " end";
                return <div key={id + n} className={tempClass} style={{ backgroundColor: tempColor }} />
            })
            }
            <div className={'legend-or-scale-text small-font fading ' + tempTextClass}>{id}</div>
        </div>
    );
}

//ref: https://dev.to/narendersaini32/how-to-create-custom-toggle-button-in-react-387m
export const ToggleButton = ({ isSelected, onToggle, selectText, nonSelectText }) => {
    return (
        <div className="toggle-container" onClick={() => onToggle()}>
            <div className={`dialog-button fading ${isSelected ? "" : "disabled"}`}>
                {isSelected ? selectText : nonSelectText}
            </div>
        </div>
    );
}

export const CausalDirectionArrow = ({ ifRight = true, ifHide = false, ifMiddleReason = false }) => {
    //if ifRight is true, the arrow pointing to the left
    //if the arrows are for middle reasons, it will be still blue even if it is pointing to the left

    var text = (ifHide) ? "      " : ((ifRight) ? "Causal Direction" : "Inference Direction");
    var x1 = (ifRight) ? "0" : "40";
    var x2 = (ifRight) ? "38.5" : "1.5";
    var arrowHead = (ifRight) ? "url(#arrowheadR)" : "url(#arrowheadL)";


    var causalColor = "rgba(0,0,255,0.5)";
    var inferenceColor = "rgba(255,0,0,0.6)";
    var textOrStrokeColor = (ifHide) ? "rgba(0,0,0,0)" : ((ifRight) ? causalColor 
        : ((ifMiddleReason) ? causalColor: inferenceColor));
    var arrowHeadColorR = (ifHide && ifRight) ? "rgba(0,0,0,0)" : causalColor;
    var arrowHeadColorL = (ifHide && (!ifRight)) ? "rgba(0,0,0,0)" 
        : ((ifMiddleReason) ? causalColor: inferenceColor);
    //console.log(ifHide && (!ifRight))

    return (
        <div className="flex-arrow">
            <div className="description tiny-font fading" style={{ color: textOrStrokeColor }}>{text}</div>
            <svg className="arrow-svg"
                xmlns="http://www.w3.org/2000/svg"
                viewBox="0 0 40 1">
                <defs>
                    <marker id="arrowheadR" markerWidth="6" markerHeight="3"
                        refX="0" refY="1.5" orient="auto">
                        <polygon style={{ fill: arrowHeadColorR }} points="0 0, 5 1.5, 0 3" />
                    </marker>
                    <marker id="arrowheadL" markerWidth="6" markerHeight="3"
                        refX="0" refY="1.5" orient="auto">
                        <polygon style={{ fill: arrowHeadColorL }} points="0 0, 5 1.5, 0 3" />
                    </marker>
                </defs>
                <line x1={x1} y1="0.5" x2={x2} y2="0.5" markerEnd={arrowHead}
                    style={{ stroke: textOrStrokeColor, strokeWidth: "0.3" }} />
            </svg>
        </div>
    );
}

